// TherapistDashboardHome.js
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import Calendar from 'react-calendar';
import axios from 'axios';
import '../styles/therapistDashboard.css';

function TherapistDashboard() {
  const navigate = useNavigate();
  const [selectedDate, setSelectedDate] = useState(new Date());
  const [showInvitationModal, setShowInvitationModal] = useState(false);
  const [inviteEmail, setInviteEmail] = useState('');
  const [inviteMsg, setInviteMsg] = useState('');

  const handleInvitationSubmit = async () => {
    try {
      const response = await axios.post('http://localhost:5000/api/invitations', { invitedEmail: inviteEmail });
      setInviteMsg('Invitación enviada con éxito.');
      setShowInvitationModal(false);
      setInviteEmail('');
    } catch (err) {
      console.error(err);
      setInviteMsg('Error al enviar la invitación.');
    }
  };

  return (
    <div className="tdh-container">
      <header className="tdh-header">
        <h1>Dashboard Terapeuta</h1>
      </header>
      
      <div className="tdh-content">
        <div className="tdh-buttons">
          <div className="tdh-group">
            <h2>HERRAMIENTAS DE GESTIÓN</h2>
            <button className="tdh-btn" onClick={() => navigate('/messaging')}>
              <i className="fa fa-comments"></i>
              Mensajería
            </button>
            <button className="tdh-btn" onClick={() => setShowInvitationModal(true)}>
              <i className="fa fa-envelope"></i>
              Generar Invitación
            </button>
            <button className="tdh-btn" onClick={() => navigate('/therapist/patients')}>
              <i className="fa fa-users"></i>
              Lista de Pacientes
            </button>
          </div>
          <div className="tdh-group">
            <h2>INFORMACIÓN ESTADÍSTICA</h2>
            <button className="tdh-btn" onClick={() => navigate('/therapist/routines')}>
              <i className="fa fa-clock-o"></i>
              Rutinas y Tiempo
            </button>
            <button className="tdh-btn" onClick={() => navigate('/therapist/interests')}>
              <i className="fa fa-line-chart"></i>
              Intereses
            </button>
            <button className="tdh-btn" onClick={() => navigate('/therapist/satisfaction')}>
              <i className="fa fa-smile-o"></i>
              Satisfacción
            </button>
          </div>
        </div>
        <div className="tdh-calendar">
          <Calendar onChange={setSelectedDate} value={selectedDate} />
        </div>
      </div>

      {showInvitationModal && (
        <div className="modal-overlay">
          <div className="modal-content">
            <h2>Generar Invitación</h2>
            <p>Introduce el correo electrónico del paciente:</p>
            <input
              type="email"
              value={inviteEmail}
              onChange={(e) => setInviteEmail(e.target.value)}
              placeholder="paciente@ejemplo.com"
            />
            <div className="modal-buttons">
              <button onClick={handleInvitationSubmit}>Enviar Invitación</button>
              <button onClick={() => setShowInvitationModal(false)}>Cancelar</button>
            </div>
            {inviteMsg && <p className="invite-msg">{inviteMsg}</p>}
          </div>
        </div>
      )}
    </div>
  );
}


export default TherapistDashboard;
